import { getOrder } from '@/api/user'
export default {
  name: 'Record',
  data() {
    return {
      data: [],
      timer: null
    }
  },
  created() {
    this.requestData()
    this.timer = setInterval(this.requestData, 5000)
  },
  beforeDestroy() {
    clearInterval(this.timer)
    this.timer = null
  },
  methods: {
    requestData() {
      getOrder().then(res => {
        this.data = res.data
      })
    }
  }

}
